***  EQLATR = Latitude of earthquake epicenter (radians).
***  EQLONR = Longitude of earthquake epicenter (radians, postive west).
***  EQRAD = Earthquake radius of influence (meters).
***  ITEQK = Date of event (modified Julian date in minutes).
***  NLOC = Number of first patch in model (nominally a fault plane or dislocation surface).
***  NFP = Total number of patches (fault planes) in model.
***
***  Each patch (fault plane) includes the following variables:
*****  STRIKE = Strike azimuth of upper edge of patch (radians).
*****  HL = Half-length (along strike) of upper edge of patch (meters).
*****  EQLAT = Latitude of upper left (northwest) corner of patch (radians).
*****  EQLON = Longitude of upper left (northwest) corner of patch (radians, postive west).
*****  SSLIP = Right-lateral strike slip displacement of patch (meters).
*****  DSLIP = Normal dip slip displacement of patch (meters).
*****  DIP = Dip of patch from horizontal (radians, <= pi/2).
*****  DEPTH = Depth of upper left (northwest) corner of patch below surface (meters).
*****  WIDTH = Width (along dip) of patch (meters).

